import React from 'react';
import VideoPlayer from "react-background-video-player";

const Video = () => {
    return (
        <div>
            <VideoPlayer
                className="video"
                src={
                    "https://www.youtube.com/watch?v=LkjUhFUEyuM&ab_channel=SentorasTV"
                }
                autoPlay={true}
                muted={true}
            />
        </div>
    );
}

export default Video;
